import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for listings to load
    await page.waitForSelector('.listing-card', { timeout: 10000 });

    // Scroll to load all listings
    await page.evaluate(async () => {
      await new Promise((resolve) => {
        let totalHeight = 0;
        const distance = 100;
        const timer = setInterval(() => {
          const scrollHeight = document.body.scrollHeight;
          window.scrollBy(0, distance);
          totalHeight += distance;

          if (totalHeight >= scrollHeight) {
            clearInterval(timer);
            resolve();
          }
        }, 100);
      });
    });

    // Extract listings with rating >= 4.8
    const highRatedListings = await page.evaluate(() => {
      const listings = [];
      const listingCards = document.querySelectorAll('.listing-card');

      for (const card of listingCards) {
        const ratingElement = card.querySelector('.listing-rating span');
        if (ratingElement) {
          const ratingText = ratingElement.textContent.trim();
          const rating = parseFloat(ratingText);

          if (!isNaN(rating) && rating >= 4.8) {
            const id = card.getAttribute('data-id') || card.id || 'unknown-id';
            listings.push({ id, rating });
          }
        }
      }

      return listings;
    });

    // Take screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_results.png'));

    return {
      success: true,
      action: "Extracted high-rated listings (rating >= 4.8)",
      extractedData: highRatedListings,
      screenshots,
      error: null
    };
  } catch (error) {
    // Take screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for listing cards to load
    await page.waitForSelector('.listing-card', { timeout: 10000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_listings_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_listings_loaded.png'));

    // Extract all listing cards
    const listings = await page.$$('.listing-card');
    const results = [];

    for (const listing of listings) {
      try {
        // Get rating element using multiple selector strategies
        const ratingElement = await listing.$('.listing-rating span');
        if (!ratingElement) continue;

        const ratingText = await ratingElement.textContent();
        const rating = parseFloat(ratingText);

        // Get listing ID from data attribute or other element
        const listingId = await listing.getAttribute('data-id') || 
                          await listing.getAttribute('id') || 
                          await (await listing.$('a')).getAttribute('href').split('/').pop();

        if (rating >= 4.8 && listingId) {
          results.push({
            id: listingId,
            rating: rating
          });
        }
      } catch (error) {
        console.log('Error processing listing:', error.message);
      }
    }

    // Take final screenshot with results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_results.png'));

    return {
      success: true,
      action: "Extracted IDs and ratings of accommodations with rating >= 4.8",
      extractedData: results,
      screenshots,
      error: null
    };
  } catch (error) {
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [...screenshots, path.join(screenshotsDir, 'error.png')],
      error: error.message
    };
  }
}
